import React, { useState, useEffect } from 'react';

import {sd} from './sd-02.png';
import { Button } from 'react-bootstrap';

import './App.scss';

function App() {
  const [modal, setModal] = useState(false);
  const [mapVisible, setMapVisible] = useState(false);

  const toggleModal = () => {
    setModal(!modal);
  };

  useEffect(() => {
    if (modal) {
      setMapVisible(true);
    }
  }, [modal]);

  const center = [15.660466, 30.846844];

  return (
    <div className="app-container">
      <button onClick={toggleModal} className="btn-modal x">
        2019
      </button>

      {modal && (
        <div className="modal">
          <div className="overlay" onClick={toggleModal}></div>
          <div className="modal-content x">
            {mapVisible && (
              <img src={require('./sd-02.png')}></img>
            )}
          </div>
        </div>
      )}


      <button onClick={toggleModal} className="btn-modal y">
        2020
      </button>

      {modal && (
        <div className="modal">
          <div className="overlay" onClick={toggleModal}></div>
          <div className="modal-content y">
            {mapVisible && (
              <img src={require('./sd-02.png')}></img>
            )}
          </div>
        </div>
      )}


      <button onClick={toggleModal} className="btn-modal z">
        2021
      </button>

      {modal && (
        <div className="modal">
          <div className="overlay" onClick={toggleModal}></div>
          <div className="modal-content z">

          <Button style={{backgroundImage:"./sd-02.png",backgroundSize:"cover", width:"40px", height:"40px"}}></Button>

          </div>
        </div>
      )}

    </div>
  );
}

const ImageWithButton = ({ imageSrc, buttonText, onClick }) => {
  return (
    <div style={{ position: "relative" }}>
      <img src={imageSrc} alt="" style={{ width: "100%" }} />
      <button
        style={{
          position: "absolute",
          top: "50%",
          left: "50%",
          transform: "translate(-50%, -50%)",
          backgroundColor: "black",
          color: "white",
          padding: "10px 20px",
          borderRadius: "5px",
          cursor: "pointer",
        }}
        onClick={onClick}
      >
        {buttonText}
      </button>
    </div>
  );
};

export default App;
